// --- Controle de Usuário ---
let users = JSON.parse(localStorage.getItem('users')) || {};
let currentUser = null;
let cart = JSON.parse(localStorage.getItem('cart')) || [];
let currentCategory = 'smartphones';
let currentIndex = 0;
const productsPerPage = window.innerWidth <= 768 ? 1 : 5;
let autoSlide;

// --- Troca de telas ---
function showScreen(id) {
  document.querySelectorAll('.screen').forEach(screen => screen.classList.add('hidden'));
  document.getElementById(id).classList.remove('hidden');
}

function handleRegister() {
  const user = document.getElementById('register-username').value;
  const pass = document.getElementById('register-password').value;
  if (user && pass && !users[user]) {
    users[user] = pass;
    localStorage.setItem('users', JSON.stringify(users));
    alert("Usuário cadastrado com sucesso!");
    showScreen('login-screen');
  } else {
    alert("Preencha os dados corretamente ou usuário já existe.");
  }
}

function handleLogin() {
  const user = document.getElementById('login-username').value;
  const pass = document.getElementById('login-password').value;
  if (users[user] === pass) {
    currentUser = user;
    showScreen('store-screen');
    renderProducts();
    renderCart();
  } else {
    alert("Usuário ou senha inválido.");
  }
}

// --- Produtos ---
function renderProducts() {
  const store = document.getElementById('store');
  store.innerHTML = '';

  const visibleProducts = getVisibleProducts();
  visibleProducts.forEach((prod, index) => {
    const div = document.createElement('div');
    div.classList.add('product');
    div.innerHTML = `
      <img src="${prod.img}" alt="${prod.name}">
      <h3>${prod.name}</h3>
      <span><s>De:${prod.price * 32}</s></span> 
      <p>R$ ${prod.price}</p>
      <button onclick="addToCart('${prod.name}', ${prod.price}, '${prod.img}')">Adicionar</button>
    `;
    store.appendChild(div);
    setTimeout(() => div.classList.add('show'), 50 * index);
  });
}

function getVisibleProducts() {
  const categoryArray = products[currentCategory];
  const total = categoryArray.length;
  const indexes = [];
  
  for (let i = 0; i < (window.innerWidth <= 768 ? 1 : 5); i++) {
    indexes.push((currentIndex + i) % total);
  }
  
  return indexes.map(i => categoryArray[i]);
}

// Navegação do carrossel
document.getElementById('nextBtn').addEventListener('click', () => {
  const categoryArray = products[currentCategory];
  currentIndex = (currentIndex + 1) % categoryArray.length;
  renderProducts();
});

document.getElementById('prevBtn').addEventListener('click', () => {
  const categoryArray = products[currentCategory];
  currentIndex = (currentIndex - 1 + categoryArray.length) % categoryArray.length;
  renderProducts();
});

// Adaptar ao redimensionar a tela
window.addEventListener('resize', () => {
  renderProducts();
});

// Inicializar
renderProducts();

// --- Controle de Categorias ---
document.querySelectorAll('.categories li').forEach((li) => {
  li.addEventListener('click', (e) => {
    const selected = e.target.getAttribute('data-category');
    if (products[selected]) {
      currentCategory = selected;
      currentIndex = 0;
      renderProducts();
      resetAutoSlide();
    }
  });
});

function next() {
  const total = products[currentCategory].length;
  currentIndex = (currentIndex + 1) % total;
  renderProducts();
}

function prev() {
  const total = products[currentCategory].length;
  currentIndex = (currentIndex - 1 + total) % total;
  renderProducts();
}

// --- Carrinho ---
function toggleCart() {
  const cartEl = document.getElementById('cart');
  if (cartEl.classList.contains('show')) {
    cartEl.classList.remove('show');
    cartEl.classList.add('hide');
    setTimeout(() => {
      cartEl.classList.add('hidden');
      cartEl.classList.remove('hide');
    }, 500);
  } else {
    cartEl.classList.remove('hidden');
    cartEl.classList.add('show');
  }
}

function addToCart(name, price, img) {
  const existing = cart.find(item => item.name === name);
  if (existing) {
    existing.quantity += 1;
  } else {
    cart.push({ name, price, img, quantity: 1 });
  }
  saveCart();
  renderCart();
}

function removeFromCart(index) {
  cart.splice(index, 1);
  saveCart();
  renderCart();
}

function renderCart() {
  const list = document.getElementById('cart-items');
  const totalEl = document.getElementById('cart-total');
  list.innerHTML = '';
  let total = 0;

  cart.forEach((item, idx) => {
    const itemTotal = item.price * item.quantity;
    total += itemTotal;
    const li = document.createElement('li');
    li.innerHTML = `
      <div class="cart-item">
        <img src="${item.img}" alt="${item.name}">
        <strong>${item.name}</strong> - R$ ${item.price}
      </div>
      <div class="quantity">
        <button onclick="updateCart(${idx}, 'decrease')">-</button>
        <input type="number" min="1" value="${item.quantity}" onchange="updateCart(${idx}, this.value)">
        <button onclick="updateCart(${idx}, 'increase')">+</button>
      </div>
      <button onclick="removeFromCart(${idx})">X</button>
    `;
    list.appendChild(li);
  });

  totalEl.innerText = `R$ ${total.toFixed(2)}`;
}

function updateCart(index, action) {
  if (typeof action === 'string') {
    if (action === 'increase') {
      cart[index].quantity += 1;
    } else if (action === 'decrease' && cart[index].quantity > 1) {
      cart[index].quantity -= 1;
    }
  } else {
    const value = parseInt(action);
    if (!isNaN(value) && value >= 1) {
      cart[index].quantity = value;
    }
  }
  saveCart();
  renderCart();
}

function saveCart() {
  localStorage.setItem('cart', JSON.stringify(cart));
}

function checkout() {
  if (cart.length === 0) return alert("Seu carrinho está vazio!");
  alert("Compra finalizada com sucesso!");
  cart = [];
  saveCart();
  renderCart();
  toggleCart();
}

// --- Navegação automática ---
document.getElementById('nextBtn').addEventListener('click', () => {
  next();
  resetAutoSlide();
});

document.getElementById('prevBtn').addEventListener('click', () => {
  prev();
  resetAutoSlide();
});

function startAutoSlide() {
  autoSlide = setInterval(next, 8000);
}

function resetAutoSlide() {
  clearInterval(autoSlide);
  startAutoSlide();
}

// Funçao para enviar o pedido ao dono da lojinha...

function gerarMensagemWhatsApp() {
  // Usa a variável global `cart` em vez do localStorage
  let mensagem = "📦 *Pedido da Cerbu's Store* 📦\n\n";
  let total = 0;

  cart.forEach((item) => {
    mensagem += `➡ ${item.name} (${item.quantity}x) - R$ ${item.price.toFixed(2)}\n`;
    total += item.price * item.quantity;
  });

  mensagem += `\n💵 *Total: R$ ${total.toFixed(2)}*`;
  return encodeURIComponent(mensagem); // Codifica para URL
}

// Funçao para enviar o pedido

function enviarPedidoWhatsApp() {
  const numeroWhatsApp = "5532999182852"; // Substitua pelo número da loja
  const mensagem = gerarMensagemWhatsApp();
  const url = `https://wa.me/${numeroWhatsApp}?text=${mensagem}`;
  window.open(url, '_blank');
}

// inicializaçao dp autoslide
startAutoSlide();

